import React, { useState, useEffect } from 'react';
import './HeroSlider.css';
import heroBackground from '../../images/hero-background.jpg'; // Using as placeholder

const HeroSlider = () => {
  const [activeSlide, setActiveSlide] = useState(1);
  
  // Auto rotate slides
  useEffect(() => {
    const interval = setInterval(() => {
      setActiveSlide(current => (current % 5) + 1);
    }, 7000);
    
    return () => clearInterval(interval);
  }, []);
  
  const handleIndicatorClick = (index) => {
    setActiveSlide(index);
  };
  
  return (
    <section className="hero-slider">
      <div className="slider-container">
        {/* Slide 1 */}
        <div className={`slide ${activeSlide === 1 ? 'active' : ''}`} style={{ backgroundImage: `url(${heroBackground})` }}>
          <div className="slide-content">
            <h1>Lunch Set Menu at Kaboul Gourmet</h1>
            <p>Indulge in a premium Afghan lunch experience on our 3-course set menu available Monday â€“ Saturday.</p>
            <a href="#discover" className="discover-btn">DISCOVER MORE</a>
          </div>
        </div>
        
        {/* Slide 2 */}
        <div className={`slide ${activeSlide === 2 ? 'active' : ''}`} style={{ backgroundImage: `url(${heroBackground})` }}>
          <div className="slide-content">
            <h1>Private Dining in Chelsea</h1>
            <p>Host your special events in our elegant private dining rooms with authentic Afghan cuisine.</p>
            <a href="#discover" className="discover-btn">DISCOVER MORE</a>
          </div>
        </div>
        
        {/* Slide 3 */}
        <div className={`slide ${activeSlide === 3 ? 'active' : ''}`} style={{ backgroundImage: `url(${heroBackground})` }}>
          <div className="slide-content">
            <h1>Special Events at Kaboul Gourmet</h1>
            <p>Join us for unique culinary events featuring traditional Afghan specialties and guest chefs.</p>
            <a href="#discover" className="discover-btn">DISCOVER MORE</a>
          </div>
        </div>
        
        {/* Slide 4 */}
        <div className={`slide ${activeSlide === 4 ? 'active' : ''}`} style={{ backgroundImage: `url(${heroBackground})` }}>
          <div className="slide-content">
            <h1>Seasonal Afghan Menu</h1>
            <p>Experience our chef's seasonal creations featuring the finest ingredients and authentic flavors.</p>
            <a href="#discover" className="discover-btn">DISCOVER MORE</a>
          </div>
        </div>
        
        {/* Slide 5 */}
        <div className={`slide ${activeSlide === 5 ? 'active' : ''}`} style={{ backgroundImage: `url(${heroBackground})` }}>
          <div className="slide-content">
            <h1>Corporate Events & Celebrations</h1>
            <p>The perfect venue for your corporate events, with personalized menus and exceptional service.</p>
            <a href="#discover" className="discover-btn">DISCOVER MORE</a>
          </div>
        </div>
      </div>
      
      <div className="slider-indicators">
        <button className={activeSlide === 1 ? 'active' : ''} onClick={() => handleIndicatorClick(1)}></button>
        <button className={activeSlide === 2 ? 'active' : ''} onClick={() => handleIndicatorClick(2)}></button>
        <button className={activeSlide === 3 ? 'active' : ''} onClick={() => handleIndicatorClick(3)}></button>
        <button className={activeSlide === 4 ? 'active' : ''} onClick={() => handleIndicatorClick(4)}></button>
        <button className={activeSlide === 5 ? 'active' : ''} onClick={() => handleIndicatorClick(5)}></button>
      </div>
    </section>
  );
};

export default HeroSlider;
